import React from 'react'
import { useMyBookingQuery } from '../../generated/graphql'
import { MyBooking } from './MyBooking';
import { PropertyList } from './PropertyList';

interface Props {

}


export const BookingRouter:  React.FC<Props> = () => {

// state implementing

    const {data, loading, error} = useMyBookingQuery()

    const bookPropListener = (booking: any) =>{
        console.log(booking)
    }

    const selectPropListener = (property: any) =>{
        prop = property;
    }


    if(loading){
        return <div>
            loading ....
        </div>
    }

    var prop = undefined

    if(error){
        console.log(error)
        return <div>err</div>
    }

    if(!data){
        return <div>
            no data
        </div>
    }



    return (
        <div>
            <MyBooking listener={bookPropListener} mybooking={data} property={prop}></MyBooking>
            <PropertyList selectPropListener={selectPropListener}></PropertyList>
        </div>
    )

}
